import React, { useState } from 'react'
import 'bootstrap/dist/css/bootstrap.min.css'

import Container from './components/Container'
function App() {
  const [tasks, setTasks] = useState([])

  return (
    <div className="App">
      <Container tasks={tasks} setTasks={setTasks} />
    </div>
  )
}

export default App
